import React,  {Component} from "react";

export default class BookCard extends Component {
    constructor(props){
        super(props);
    }
    render() {
        const {book} = this.props;
        return(
            <div className="card">
                <img src="{this.state.books.image}"/>
                <h4>{this.state.books.title}</h4>
                <h5>{this.state.books.author}</h5>
            </div>
        );
    }
}
